import React from "react";
import Button from "@mui/material/Button";
import { Delete } from "@mui/icons-material";

const SideBarButton = () => {
  return (
    <div>
      <Button startIcon={<Delete />}>Home</Button>
    </div>
  );
};

export default SideBarButton;
